import React from 'react';
import Note from './Note';

const NoteList = ({ notes, onEditNote, onDeleteNote }) => {
    return (
        <div>
            {notes.map(note => (
                <Note 
                    key={note.id} 
                    note={note} 
                    onEdit={onEditNote} 
                    onDelete={onDeleteNote} 
                />
            ))}
        </div>
    );
};

export default NoteList;
